import React from "react";
import Button from "@material-ui/core/Button";
import { Paper, Container, CssBaseline, Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  main: {
    padding: theme.spacing(14),
  },
}));

function Title() {
  return (
    <>
      <Typography
        component="h1"
        variant="h2"
        align="center"
        color="textPrimary"
      >
        hmm
      </Typography>
      <Typography
        component="h5"
        variant="h6"
        align="center"
        color="textPrimary"
        gutterBottom
      >
        what's on your mind?
      </Typography>
    </>
  );
}

function App() {
  const classes = useStyles();

  return (
      <main className={classes.main}>
        <Container component="main" maxWidth="md">
          <CssBaseline />
          <Title />
          <Container maxWidth="xs">
            <Paper>
            <Typography
        component="h3"
        variant="h4"
        align="center"
        color="textPrimary"
      >new hmm</Typography>
              <Button variant="contained" color="primary">
                Hello World
              </Button>
            </Paper>
          </Container>
        </Container>
      </main>
  );
}

export default App;
